import React from 'react';
import ReactDom from 'react-dom';

const App = () =>{
    return(
        <div className="container">
        <form>
        <h2>Create Your Account</h2>
        <input required placeholder="Registration Number"type=""></input>
        <input required placeholder="Chasis Number" type=""></input>
        <input required placeholder="Username"></input>
        <label> <img src=""  />
        <input  required placeholder="Email" type="Email"></input>
        </label>
        <input required placeholder="Password" type="Password"></input>
        <input required placeholder="Confirm Password" type="Password"></input>
        
        </form>
        
        
        
        </div>
    );
};











ReactDom.render(<App />,document.querySelector('#root'));
